import React from "react";
import './styles/navBar.css';
import logoFily from "./images/logo.svg"

function NavBar() {
  return (
    <nav className="nav-container">
    <img src={logoFily} alt="logo-file"></img>

    </nav>
  );
}

export default NavBar;
